SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "roads" (gid serial PRIMARY KEY,
"osm_id" numeric(11,0),
"name" varchar(48),
"ref" varchar(16),
"type" varchar(16),
"oneway" int2,
"bridge" int2,
"maxspeed" int2);
SELECT AddGeometryColumn('','roads','the_geom','-1','MULTILINESTRING',2);
CREATE INDEX "roads_the_geom_gist" ON "roads" using gist ("the_geom" gist_geometry_ops);
COMMIT;
